import { useAcey } from 'acey'
import { Counter, Todolist } from '../src/models'

export default function Home(props) {
  useAcey([
    Counter,
    Todolist
  ])

  const add = () => Todolist.push({ id: Math.random(), content: Math.random().toString() }).save().cookie()

  return (
    <div className="container">
      <button onClick={Counter.decrement}>decrement</button>
      {Counter.get()}
      <button onClick={Counter.increment}>increment</button>

      <button onClick={add}>add</button>
      <div>
        {Todolist.map((v, index) => {
          return (
            <div key={index}>
              <span>{v.content()} : </span>
              <span>{v.ID()}</span>
            </div>
          )
        })}
      </div>

    </div>
  )
}

Home.getInitialProps = ({ query }) => {
  return {
    id: 10
  }
}
